var logError = function(error, exc){
  log("ERROR-"+error.toUpperCase()+"["+getTime()+"] "+exc.name+": "+exc.message+"\n()");
  if(firstExc==null){
    firstExc = exc;
  }
  if(crashOnError){
    log(exc.stack);
    log("Mod crashed on error, as requested.")
    game.modding.commands.stop()
  }
}

