SPPages = {"changelog":[{"type":1,"data":"Changelog"},{"type":2}],"credits":[{"type":1,"data":"STARBLAST PROTOTYPES"},{"type":3,"widths":[50,50],"data":["Zero mining.","Pure combat."]},{"type":0,"data":""},{"type":1,"data":"Lead developer/idea by"},{"type":0,"data":"/u/UranusOrbiter Uranus_is_big#7833"},{"type":1,"data":"Main tester/obscure bug fixing/helper/developer"},{"type":0,"data":"123 Notus"},{"type":1,"data":"Ships by"},{"type":0,"data":"UranusOrbiter"},{"type":0,"data":"Goldman"},{"type":0,"data":"Finalizer"},{"type":0,"data":"Malefor"},{"type":0,"data":"5STARS"},{"type":0,"data":"Interdictor SD"},{"type":2},{"type":0,"data":"Huge thanks for everyone who, in one way or another, contributed to the amazing cause of SPrototypes, the Moddest of all mods. Without your help, your contributions, none of this would exist. You wouldn't be reading this text in an in-game web browser."},{"type":1,"data":"Thank you."},{"type":0,"data":"Huge thanks to our beloved dev, pmgl, for designing this mind-bogglingly awesome modding system, for putting up with the incredibly annoying me, and for encouraging me to do all of this."},{"type":0,"data":"Thanks to all playtesters, including but not limited to(because my brain's memory is very limited): "},{"type":0,"data":"Nova, PearEatingBear, Zeul, L.Gaming, IRAN, ECLIPSE, Goldman, NeXagon, ACE, APPLE PIE, and all others."},{"type":0,"data":"One cannot develop a mod for so many players without testing it with that many players. Thus, thank you for being my audience for all these weeks, and thank you for all the feedback and gameplay."},{"type":0,"data":"Special thanks to 201X CAPTAIN and REBEL for letting me use their discord server for invites and announcements."},{"type":0,"data":"Oh and of course, shoutout to all the haters! I'd like to thank y'all for providing me with motivation to keep going. You don't deserve having your names put here, though... sorry for that!"},{"type":2},{"type":0,"data":"Also shoutout to these awesome sites that turned out to be very, very useful for developing such a large mod:"},{"type":0,"data":"esprima.org - great online js syntax checker"},{"type":0,"data":"color-hex.com - awesome color palettes for skins"},{"type":0,"data":"stackoverflow.com - but of course"},{"type":0,"data":"emojipedia.org - great insight into emojis"},{"type":2},{"type":0,"data":"%wiki%In-game wiki(under construction)"},{"type":0,"data":"%changelog%Changelog"},{"type":0,"data":"%doesntExist%Go check out our 404 page lmao"},{"type":2},{"type":0,"data":"{} by UranusOrbiter with ðŸ’–"}],"wiki":[{"type":1,"data":"STARBLAST PROTOTYPES"},{"type":3,"widths":[50,50],"data":["Zero mining.","Pure combat."]},{"type":0,"data":""},{"type":2},{"type":1,"data":"In-game wiki"},{"type":1,"data":"THIS IS A PROOF OF CONCEPT"},{"type":0,"data":"This right here is just a placeholder page for the yet-to-be-added in-game encyclopedia.The links currently point nowhere. It will be populated with pages in future."},{"type":2},{"type":0,"data":"STARBLAST PROTOTYPES: Zero mining. Pure combat is a highly complex interactive mod for online multiplayer game Starblast. It's main premise is the idea that mining is a useless, poisonous feature that adds very little to gameplay, at the cost of making the game a huge uncompetitive timesink. SP is designed to be a quick, objective-based mode, where all players are treated as equal. It is, in a way, a merger of Pro DeathMatch and Vanilla Teams, taking best features from both modes while filtering out useless ones."},{"type":2},{"type":0,"data":"Gameplay is spiced up by the addition of %abilities%abilities in an attempt to parody Overwatch. All ships have unique abilities that question the limits of Modding API. %effects%Effects can be applied to ships by abilities, increasing gameplay complexity and making room for strategy and tactics. Ships are completely free and the only penalty for dying is loss of points(kills).Most rounds last 10-20 minutes, with the shortest possible round being 5 minutes. Gameplay is fast and engaging."},{"type":2},{"type":0,"data":"%ships%Ships"},{"type":0,"data":"%shipStats%Ship stats"},{"type":0,"data":"%abilities%Abilities"},{"type":0,"data":"%effects%Effects"}]};


